0','시츄',33,'ㅁ',0),(21,'test01',1,'2020-04-03 13:00:47','2020-04-06 00:00:00','2020-04-10 00:00:00','불독',12,'ㅇ',0),(22,'test01',2,'2020-04-09 11:35:05','2020-04-10 00:00:00','2020-04-14 00:00:00','핏불',6,'1년 5개월된 4.5kg 믹스견 암컷을 키우고 있습니다.\r\n3개월령 되는 시기에 입양해 줄곧 함께하는 친구입니다.\r\n어렸을때부터 하루한번 산책을 해왔지만 사회성이 조금 부족한것 같아요\r\n먼저.. 성격을 알려드리자면\r\n1. 겁이 많고 예민해요.\r\n2. 소형견 중 탑급 빠르기와 힘.. 어마어마한 점프력\r\n3. 집안에서 짖는 일 없구요\r\n4. 매일 실외배변하며 실내에서는 지정된 장소에서만 합니다.\r\n5. 이리와 앉아 엎드려 누워 말도 잘 알아듣구요..\r\n6. 애정행동도 많이 보여줍니다.\r\n',0),(23,'test01',0,'2020-04-09 11:57:58','2020-04-11 00:00:00','2020-04-12 00:00:00','믹스견',3,'1년 5개월된 4.5kg 믹스견 암컷을 키우고 있습니다.\r\n3개월령 되는 시기에 입양해 줄곧 함께하는 친구입니다.\r\n어렸을때부터 하루한번 산책을 해왔지만 사회성이 조금 부족한것 같아요\r\n먼저.. 성격을 알려드리자면\r\n1. 겁이 많고 예민해요.\r\n2. 소형견 중 탑급 빠르기와 힘.. 어마어마한 점프력\r\n3. 애정행동도 많이 보여줍니다.\r\n4. 매일 실외배변하며 실내에서는 지정된 장소에서만 합니다.\r\n5. 집안에서 짖는 일 음슴\r\n',0),(24,'test01',0,'2020-04-09 12:02:12','2020-04-10 00:00:00','2020-04-10 00:00:00','sdf',2,'집에온지 일주일에 한달된강아지입니다\r\n적응을햇는지 집안구석구석 돌이댕깁니다\r\n문제가있는데 옷이나 이불을 물을려고합니다 장난감 같이\r\n그리고 제방에 매트릭스침대가 편한지 자기집놔두고 계속와서\r\n이불을물고 거기위에서 잡니다 밤이나 낮이나 잠 안자고 문닫고 잘려고하면 열어달라고 계속 낑낑됍니다\r\n잠을 제대로못자겠구요',0),(25,'test01',0,'2020-04-09 12:06:55','2020-04-10 00:00:00','2020-04-14 00:00:00','웰시코기',17,'문제가있는데 옷이나 이불을 물을려고합니다 장난감 같이\r\n그리고 제방에 매트릭스침대가 편한지 자기집놔두고 계속와서\r\n이불을물고 거기위에서 잡니다 밤이나 낮이나 잠 안자고 문닫고 잘려고하면 열어달라고 계속 낑낑됍니다\r\n',1),(26,'dmswjd12',3,'2020-04-09 14:28:30','2020-04-10 00:00:00','2020-04-10 00:00:00','웰시코기',1,'1년 이내 5가지 접종(종합, 코로나, 켄넬코프, 신종 인플루엔자, 광견병) 받지\r\n않은 반려견은 입실이 제한됩니다.\r\n* 접종기록은 접종병원명이 꼭 필요하므로 증빙 자료는 미리 준비해주세요.',0),(27,'dmswjd12',2,'2020-04-09 17:39:53','2020-04-10 00:00:00','2020-04-16 00:00:00','시바',1,'rrr',1),(28,'dmswjd12',2,'2020-04-09 17:43:29','2020-04-10 00:00:00','2020-04-14 00:00:00','슈나우져',2,'예약되나요',3),(29,'dmswjd12',2,'2020-04-09 17:46:21','2020-04-10 00:00:00','2020-04-16 00:00:00','시바',2,'alert 뜨나요',2),(30,'dmswjd12',2,'2020-04-10 09:49:31','2020-04-10 00:00:00','2020-04-12 00:00:00','코카스파니엘',12,'1살 미만의 반려동물인 경우 항체 검사가 필수 입니다.\r\n(단, 1살 이상 시 재접종 기록 확인)',3),(31,'1111',0,'2020-04-16 10:21:36','2020-04-21 00:00:00','2020-04-23 00:00:00','시바',2,'예약해주세요',0);
